import React, { Component } from "react";
import "./App.css";
import FetchLatLon from "./components/FetchLatLon";
import FetchBands from "./components/FetchBands";
import Input from "./components/Input";

let location = {
  name: '',
  lat: '',
  lon: ''
}

class App extends Component {
  state = {
    visible: true
  };


  render() {
    return (
      <div className="App">
        <FetchLatLon />
        <FetchBands />
        <form>
          <Input />
        </form>
      </div>
    );
  }
}

React.render(<App location={location} />, document.getElementById('App'));
export default App;
